import React from "react";
import NavBar from "./NavBar";
import img1 from '../img/pier1.jpeg'
import Style from '../styles/Home.module.css'

export default function Home() {
    return (
        <>
            <NavBar />
            <div className={Style.container}>
                <div>
                    <img src={img1} alt="imagen personal" />
                </div>
                <div>
                    <h1>I'm Pierino Juncos</h1>
                    <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Recusandae voluptatem sint rerum rem officia aut enim impedit nobis, sequi laborum ab, ipsa fuga alias eaque officiis vitae accusamus magnam itaque!</p>
                </div>
            </div>
        </>
    )
}
